import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import SmartToyIcon from '@mui/icons-material/SmartToy';
import IconButton from '@mui/material/IconButton';
import Tooltip from '@mui/material/Tooltip';
import Button from '@mui/material/Button';
import { useNavigate } from 'react-router-dom';

const Privacy = () => {
  const navigate = useNavigate();
  return (
    <>
      {/* ヘッダー（ロゴのみ） */}
      <Box
        sx={{
          position: 'fixed',
          top: 0,
          left: 0,
          width: '100vw',
          height: 56,
          zIndex: 1200,
          display: 'flex',
          alignItems: 'center',
          boxShadow: 4,
          background: '#fff',
          color: '#222',
          backdropFilter: 'blur(10px)',
        }}
      >
        <Box sx={{
          width: { xs: 0, md: 74 },
          height: '100%',
          bgcolor: { md: '#111', xs: 'transparent' },
          flexShrink: 0,
          display: { xs: 'none', md: 'flex' },
          alignItems: 'center',
          justifyContent: 'center',
        }}>
          <img src="/service-logos/logo-vertical.png" alt="AI Golf" style={{ height: 46, maxWidth: 74, objectFit: 'contain', background: 'transparent', display: 'block', margin: 0, padding: 0 }} />
        </Box>
      </Box>
      {/* サイドバー＋本文レイアウト */}
      <Box sx={{ display: 'flex', flexDirection: 'row', pt: '56px', minHeight: '100vh', background: 'linear-gradient(135deg, #F7F9FB 0%, #E3E6EA 100%)' }}>
        {/* サイドバー（トップページと同じデザイン, Xリンク常時表示） */}
        <Box
          sx={{
            width: { xs: 0, md: 74 },
            minWidth: { md: 74 },
            bgcolor: { xs: 'transparent', md: '#fff' },
            color: '#222',
            display: { xs: 'none', md: 'flex' },
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'space-between',
            height: 'calc(100vh - 56px)',
            boxShadow: { md: 2, xs: 0 },
            borderRight: { md: '1px solid', xs: 'none' },
            borderColor: { md: '#E3E6EA', xs: 'transparent' },
            position: 'static',
            top: 'auto',
            left: 'auto',
            zIndex: 100,
            p: 0,
            m: 0,
            boxSizing: 'border-box',
          }}
        >
          {/* 上部：AI診断 */}
          <Box sx={{ mt: 1 }}>
            <Box
              sx={{
                display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 0.5, width: '100%', py: 1,
                cursor: 'pointer',
                color: '#111',
                fontWeight: 700,
                '& svg': { color: '#111' }
              }}
              tabIndex={0}
              role="button"
              onClick={() => navigate('/')}
            >
              <SmartToyIcon sx={{ fontSize: 23, mb: 0.5, transition: 'color 0.18s' }} />
              <span style={{ fontWeight: 700, fontSize: 12, letterSpacing: 1 }}>AI診断</span>
            </Box>
          </Box>
          {/* 下部：Xリンク */}
          <Box sx={{ mb: 2 }}>
            <Tooltip
              title={<span>お問い合わせは<br />DMまで</span>}
              arrow
              placement="top"
              PopperProps={{
                modifiers: [
                  { name: 'offset', options: { offset: [12, 8] } },
                ],
              }}
              componentsProps={{
                tooltip: {
                  sx: {
                    fontSize: 13,
                    fontWeight: 500,
                    bgcolor: '#222',
                    color: '#fff',
                    borderRadius: 2,
                    px: 1.5,
                    py: 0.7,
                    boxShadow: '0 2px 8px rgba(0,0,0,0.10)'
                  }
                }
              }}
            >
              <IconButton
                component="a"
                href="https://x.com/golf_ai_t"
                target="_blank"
                sx={{ color: '#222', p: 0.5, '&:hover': { color: '#1976D2', opacity: 1 } }}
              >
                <img src="/sns-logos/logo-black.png" alt="Xロゴ" width="17" height="17" />
              </IconButton>
            </Tooltip>
          </Box>
        </Box>
        {/* 本文（本当に中央寄せ・幅拡大） */}
        <Box sx={{
          flex: 1,
          width: '100%',
          minHeight: 'calc(100vh - 56px)',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          px: 2,
        }}>
          <Box sx={{
            maxWidth: 800,
            width: '100%',
            bgcolor: '#fff',
            borderRadius: 4,
            boxShadow: 2,
            p: { xs: 2, sm: 3, md: 4 },
            textAlign: 'center',
          }}>
            <Typography variant="h4" sx={{ fontWeight: 700, mb: 2, textAlign: 'center' }}>
              プライバシーポリシー
            </Typography>
            <Typography sx={{ fontSize: 15, color: '#444', mb: 2, textAlign: 'center' }}>
              本サービス（AIゴルフクラブ診断β版）は、ユーザーのプライバシーを尊重し、個人情報の保護に努めます。
            </Typography>
            <Typography sx={{ fontSize: 14, color: '#666', mb: 2, textAlign: 'center' }}>
              ※本ページはダミーです。正式なプライバシーポリシー文をここに掲載してください。
            </Typography>
            <Typography sx={{ fontSize: 13, color: '#888', mb: 4, textAlign: 'left' }}>
              1. 本サービスは、サービス向上のためにアクセス解析等を行う場合があります。<br />
              2. 取得した情報は、法令に基づく場合を除き、第三者に提供しません。<br />
              3. その他、個人情報の取り扱いについては本ページにて随時告知します。
            </Typography>
            <Box sx={{ textAlign: 'center', mt: 4 }}>
              <Button variant="outlined" color="primary" onClick={() => navigate('/')} sx={{ borderRadius: 999, px: 4, py: 1, fontWeight: 700 }}>
                診断に戻る
              </Button>
            </Box>
          </Box>
        </Box>
      </Box>
    </>
  );
};

export default Privacy;
